import Auth from 'pages/Auth';
import Home from 'pages/Home';
import { Route, Router, Switch } from 'react-router-dom';
import history from 'util/history';

const Routes = () => {
  return (
    <Router history={history}>
      <Switch>
        <Route path="/" exact>
          <Auth />
        </Route>

        <Route path="/home" exact>
          <Home />
        </Route>
      </Switch>
    </Router>
  );
};

export default Routes;
